import React from 'react';
import Start from "../assets/Start.png";

function Home() {
    return (
        <div classname = "center">
           <div className = "center"></div> <img src={Start} alt=""></img>
          <head>
        <link rel="StyleSheet" href="https://www.canva.com/design/DAEqjZSvbjM/view">
          </link>
          </head>
      <p>Nieuwstadt - Limburg</p> 
      </div>  

    )
}

export default Home;
